import React from "React";

class Footer extends Component {
  render() {
    return (
      <div>
        <Navbar color="dark" dark>
          <Container>
            <NavbarBrand>Footer</NavbarBrand>
          </Container>
        </Navbar>
      </div>
    );
  }
}
export default Footer;
